INSERT INTO `stet_categories` VALUES (1,'Misc Software','2021-08-03 21:18:59','2021-08-03 21:18:59',NULL,NULL,NULL,0,0,'license',0,NULL),(2,'Laptop','2021-08-03 08:35:03','2022-08-16 01:05:24',NULL,NULL,'1. PC/Notebook milik PT. BINA PERTIWI dan telah diinstall software standart BP ( Windows 11, Ms.Office, SAP, Antivirus & Utility ). Pemakai/user tidak diperkenankan untuk menginstall software tambahan tanpa sepengetahuan IT, hal ini dimaksudkan untuk memperkecil resiko problem notebook. Jika pemakai/user ingin menginstall software tambahan sesusai dengan kebutuhan perusahaan, maka pemakai/user harus melaporkan kepada atasan ybs terlebih dulu.\r\n2. Apabila terjadi masalah pada software yang disebabkan oleh kelalaian pemakai/user sehingga notebook tidak bisa dioperasikan, maka pemakai/user segera menginformasikan kepada IT di ketahui atasan langsung..\r\n3. Pemakai/user wajib untuk merawat dan menjaga notebook dan tidak diperkenankan untuk meminjamkan kepada orang lain. Jika terjadi kerusakan berat pada fisik maupun komponen Notebook karena kelalaian pemakai/user, maka pemakai/user diwajibkan untuk mengganti komponen/notebook tsb.\r\n4. Jika pemakai/user mendapatkan pengganti notebook yang lebih baru (peremajaan atau disesuaikan dengan kebutuhan user untuk perusahaan), maka notebook yang lama harus dikembalikan ke IT untuk diregistrasi  kelengkapannya, apabila pada saat penyerahan notebook kepada IT dalam kondisi tidak lengkap maka pemakai/user wajib untuk mengganti barang yang tidak ada.\r\n5. Apabila terjadi kehilangan notebook yang disebabkan oleh kelalaian pemakai/user notebook tsb, maka pemakai/user segera membuat laporan tertulis kepada atasan langsung. Pada saat bersamaan, pemakai/user notebook tsb diwajibkan membuat Berita Acara Kehilangan ditanda-tangani oleh atasan langsung dan diserahkan ke IT untuk diproses lebih lanjut. Atasan pemakai/user wajib memberikan Surat Peringatan kepada pemakai/user tsb yang disebabkan oleh kelalaian pemakai/user.',1,1,'asset',